import React from "react"

const ImageSilder = ({ link, alt }) => {
  return (
    <div className="imagesilder">
      <img
        src={
          "{" +
          "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSO2JpOjjlfQ8jiR9rNo8NHmgisBkHSUHwkpJ3ycr5-GUmvuFSRig" +
          "+"
        }
        alt={alt}
      />
      This is Slider
    </div>
  )
}
export default ImageSilder
